import './App.css';
import DopComponent from './example';




import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch
} from 'react-router-dom';


export default function App() {
  return (
    <Router>
      <div>
        <div>
        <Link class = 'li' to="/dop">Главная</Link>
        <Link class = 'li' to="/dop">Логин</Link>
        <Link class = 'li' to="/dop">Новости</Link>
        <Link class = 'li' to="/dop">Профиль</Link>


        </div>
        <ul>
          <li>
            <button variant="contained" color="secondary">
            <Link class = 'li' to="/dop">DOP</Link>
            </button>
          </li>
        </ul>

        <Switch>
          <Route component={DopComponent} path="/dop" />
        </Switch>
      </div>
    </Router>
  );
}
